import "./crud.css"
import React, { useState } from "react"
 function Navi(){
     const [email,setemail]=useState()
     const [password,setpassword]=useState()
    return(
        <div>
            <label>email:</label>
            <input type="email" placeholder="email"/>
            <br/><br></br>
            <label>password:</label>
            <input type="password" placeholder="password"/>
            <br/><br></br>
            <button>Login</button>
        </div>
    )
 }
 export default Navi;
